import React from 'react';
import { useNavigate } from 'react-router-dom';
import './CSS/Home.css'; 

const Landing: React.FC = () => {
  const navigate = useNavigate();

  return (
    <div className="home">
      <section className="hero">
        <h1 className="title">Welcome to ShelfAware üçÖ</h1>
        <p className="subtitle">Smart pantry management for students who forget what's in the fridge.</p>
        <div style={{ display: 'flex', gap: '1rem', justifyContent: 'center' }}>
          <button className="cta-button" onClick={() => navigate('/login')}>Log In</button>
          <button className="cta-button" onClick={() => navigate('/signup')}>Sign Up</button>
        </div>
      </section>
    </div>
  );
};

export default Landing;
